CREATE TABLE m_skill_target(
  id INTEGER NOT NULL,
  only_owner INTEGER NOT NULL,
  excluding_owner INTEGER NOT NULL,
  random_choose_count INTEGER NOT NULL,
  target_attribute_group_id INTEGER,
  target_member_group_id INTEGER,
  target_unit_group_id INTEGER,
  target_school_group_id INTEGER,
  target_school_grade_group_id INTEGER,
  target_role_group_id INTEGER,
  checking_owner_party INTEGER NOT NULL,
  checking_owner_school INTEGER NOT NULL,
  checking_owner_grade INTEGER NOT NULL,
  checking_owner_unit INTEGER NOT NULL,
  checking_owner_attribute INTEGER NOT NULL,
  checking_owner_role INTEGER NOT NULL,
  target_party_type_id INTEGER,
  PRIMARY KEY (id)
);
